import React from 'react';
import {useNavigate} from "react-router-dom";
import {useGlobalContext} from "../context";

const Dashboard = () => {
    const {user} = useGlobalContext();
    const navigate = useNavigate();
    if (!user) {
        navigate('/');
    }
    return (
        <div>
            Dashboard
        </div>
    );
};

export default Dashboard;
